        setCurrentquestion([Math.floor(Math.random()*10),Math.floor(Math.random()*10)])
        event.preventDefault()
       // setResults((prevState)=>)

    } 
    const displayLog = ()=>{
        return(
            results.map((r)=>(<ResultElem text={r}/>))
        )
